import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ExperienceCard from './ExperienceCard';

const OrgDashboard = ({ token }) => {
  const [formData, setFormData] = useState({ activityName: '', achievementLevel: '', description: '', date: '', studentEmail: '' });
  const [files, setFiles] = useState([]);
  const [experiences, setExperiences] = useState([]);
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    const fetchExperiences = async () => {
      const config = { headers: { Authorization: `Bearer ${token}` } };
      try {
        const res = await axios.get('/api/experience', config); // Org can see all their added experiences
        setExperiences(res.data);
      } catch (err) {
        alert('Error fetching experiences: ' + (err.response?.data?.error || 'Unknown error'));
      }
    };
    fetchExperiences();
  }, [token]);

  const handleChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleFileChange = e => setFiles(e.target.files);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    Object.keys(formData).forEach(key => data.append(key, formData[key]));
    Array.from(files).forEach(file => data.append('documents', file));
    const config = { headers: { Authorization: `Bearer ${token}`, 'Content-Type': 'multipart/form-data' } };
    try {
      if (editingId) {
        await axios.patch(`/api/experience/${editingId}`, data, config);
        setEditingId(null);
      } else {
        await axios.post('/api/experience', data, config);
      }
      // Refresh experiences
      const res = await axios.get('/api/experience', { headers: { Authorization: `Bearer ${token}` } });
      setExperiences(res.data);
      setFormData({ activityName: '', achievementLevel: '', description: '', date: '', studentEmail: '' });
      setFiles([]);
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  const handleEdit = (exp) => {
    setFormData({
      activityName: exp.activityName,
      achievementLevel: exp.achievementLevel,
      description: exp.description,
      date: exp.date.split('T')[0],
      studentEmail: exp.studentEmail,
    });
    setEditingId(exp._id);
  };

  const handleDelete = async (id) => {
    const config = { headers: { Authorization: `Bearer ${token}` } };
    try {
      await axios.delete(`/api/experience/${id}`, config);
      setExperiences(prev => prev.filter(exp => exp._id !== id));
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  return (
    <div className="p-4">
      <h1 className="text-2xl mb-4">Organization Dashboard</h1>
      <form onSubmit={handleSubmit} className="bg-white p-4 shadow rounded mb-4">
        <input name="activityName" value={formData.activityName} onChange={handleChange} placeholder="Activity Name" className="border p-2 w-full mb-2 rounded" required />
        <input name="achievementLevel" value={formData.achievementLevel} onChange={handleChange} placeholder="Achievement Level" className="border p-2 w-full mb-2 rounded" required />
        <textarea name="description" value={formData.description} onChange={handleChange} placeholder="Description" className="border p-2 w-full mb-2 rounded" required />
        <input type="date" name="date" value={formData.date} onChange={handleChange} className="border p-2 w-full mb-2 rounded" required />
        <input name="studentEmail" value={formData.studentEmail} onChange={handleChange} placeholder="Student Email" className="border p-2 w-full mb-2 rounded" required />
        <input type="file" multiple onChange={handleFileChange} className="mb-2" />
        <button type="submit" className="bg-green-500 text-white p-2 w-full rounded hover:bg-green-600">{editingId ? 'Update' : 'Add'} Experience</button>
      </form>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        {experiences.map(exp => (
          <div key={exp._id} className="bg-white p-4 shadow rounded">
            <ExperienceCard exp={exp} role="organization" />
            <button onClick={() => handleEdit(exp)} className="bg-yellow-500 text-white p-1 mr-2">Edit</button>
            <button onClick={() => handleDelete(exp._id)} className="bg-red-500 text-white p-1">Delete</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OrgDashboard;
